export default function ThongTinDatGhe() {
  return (
    <div className='mt-5 '>
        <button className='gheDuocChon' style={{marginLeft:0}}></button><span className='text-light mx-2'>Ghế Đã Đặt</span>
        <br />
        <button className='gheDangChon' style={{marginLeft:0}}></button><span className='text-light mx-2'>Ghế Đang Đặt</span>
        <br />
        <button className='ghe'></button><span className='text-light mx-2'>Ghế Chưa Đặt</span>
    </div>
  )
}
